//弃用
//用于生成页面地图数据的
function echartPartyBranch(id){
    var val;
    $.ajax({
        method : "post",
        async:false,
        url:contextPath+"/partyDp/getPartyBranch",
        data:{"levels":"3","parentId":id},
        dataType:"json",
        success:function(result){
            var data =result.rows;
            var partyFeature=[];
            $(data).each(function (i,v) {
                var str = eval(this.points);
                if(str){
                    var parentId=this.parentId;
                    var partyName = this.name;
                    var id = this.id;
                    $(str).each(function(){
                        this.push(this[0]);
                        var polygonGrid={
                            "type": "Feature",
                            "properties": {
                                "id":id,
                                "communityId":parentId,
                                "name":partyName
                            },
                            "geometry": {
                                "type": "Polygon",
                                "coordinates": str
                            }
                        };
                        partyFeature.push(polygonGrid);
                    });
                }
            });
            var feature={
                "type": "FeatureCollection",
                "features": partyFeature
            };
            val=JSON.stringify(feature)
        }
    });
    return val;
}
